@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:BankCode a owl:Class .

atm:InvalidBankCode a owl:Class ;
    rdfs:subClassOf atm:BankCode ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasMessage ;
                          owl:hasValue "bad bank code" ] .

atm:BankComputer a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:sendsMessageTo ;
                      owl:allValuesFrom atm:ATM ] .

atm:hasMessage a owl:ObjectProperty ;
    rdfs:domain atm:InvalidBankCode ;
    rdfs:range rdfs:Literal .

atm:sendsMessageTo a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:ATM .

atm:ATM a owl:Class .
